import React from "react";
import Button from "@material-ui/core/Button";
import { formDataToObject } from "./utils";
import ATextField from "./aTextField";

function handleSubmit(event) {
  event.preventDefault();
  const formData = new FormData(event.target);
  console.log("handleSubmit: " + JSON.stringify(formDataToObject(formData)));
}

const AForm = (props) => {
  return (
    <form onSubmit={handleSubmit}>
      <ATextField name="firstName" defaultValue="abc" />
      <ATextField name="lastName" />
      <ATextField
        name="address1"
        label="Address"
        autocompleteOptions={[{ label: "Label 1", value: "Value 1" }]}
      />
      <ATextField label="Comments" multiline />
      <Button type="submit">Submit</Button>
    </form>
  );
};

export default AForm;
